function pickIndex(e){return Math.floor(Math.random()*e.length)}function pickOne(e){return e[pickIndex(e)]}function goToRandomUrl(e){var e=e.filter(function(e){return!window.location.href.endsWith(e)});window.location.href=pickOne(e)}function scrollToTopAndBlur(){window.scrollTo(0,0),document.activeElement.blur()}